import React from "react";
import styled from "styled-components";
import head from "../canes.png";

export default function Header() {
  return (
    <section className="reltaive">
      <div
        className="min-h-screen hero-image bg-right-bottom bg-cover flex"
        style={{ backgroundImage: "url(" + head + ")" }}
      >
        <div>
          <div className="content float-left py-4 px-5 my-5"></div>
        </div>
      </div>
    </section>
  );
}
